import React, {useState,useEffect} from "react";
import { Paper, Typography, TextField, Button } from "@material-ui/core";
import FileBase from 'react-file-base64';
import useStyles from './styles';
import {useDispatch,useSelector} from "react-redux";
import {createPost, updatePost} from "../../actions/posts"; 

const Form = ({currentId, setCurrentId}) => {
    const [postData, setPostData] = useState({
        title: '', message: '', tags: '', selectedFile: ''
    });
    const post = useSelector((state) => currentId ? state.posts.posts.find((p) => p._id === currentId) : null);
const classes = useStyles();
const dispatch = useDispatch();
const user = JSON.parse(localStorage.getItem('profile'));

useEffect(() => {
    if(post) setPostData(post);
}, [post]);

const handleSubmit = (e) => {
    e.preventDefault();

    if(currentId){
        dispatch(updatePost(currentId, {...postData, name: user?.result?.name}));
       
    }else{
        dispatch(createPost({...postData, name: user?.result?.name})); 
    }
    clear();

    
}

if(!user?.result?.name){
    
    return(
        <Paper className={classes.typo}>
            <Typography  align="center">
                Please Sign In to create your own posts and see other's posts!
                </Typography>
        </Paper>
    )
}
 

const clear = () => {
    setCurrentId(null);
    setPostData({ title: '', message: '', tags: '', selectedFile: ''});
}

if(user?.result?.name === 'Veteran NGO'){
    return(
        <Paper className={classes.paper} elevation={6}>
            <form autoComplete="off" noValidate className={`${classes.root} ${classes.form}`} onSubmit={handleSubmit}>
                <Typography variant="h6">{currentId ? 'Editing' : 'Creating'} a Event</Typography>
                <TextField name="title" variant="outlined" label="Title of Event" fullWidth value={postData.title} onChange={(e) => setPostData({...postData,title: e.target.value})}/>
                <TextField name="message" variant="outlined" label="Message" fullWidth multiline rows={4} value={postData.message} onChange={(e) => setPostData({...postData,message: e.target.value})}/>
                <TextField name="tags" variant="outlined" label="Starting Date" fullWidth value={postData.tags} onChange={(e) => setPostData({...postData,tags: e.target.value})}/>
                <div className={classes.fileInput}>
                    <FileBase type="file" multiple={false} onDone={({base64}) => setPostData({...postData,selectedFile: base64})}/>
                </div>
                <Button className={classes.buttonSubmit} variant="contained" color="primary" size="large" type="submit" >Submit</Button>
                <Button className={classes.buttonClear} variant="contained" color="secondary" size="large" onClick={clear} >Clear</Button>
                
            </form>
        </Paper>
    );
}
else{

    return (
        
        <Paper className={classes.paper} elevation={6}>
            <form autoComplete="off" noValidate className={`${classes.root} ${classes.form}`} onSubmit={handleSubmit}>
                <Typography variant="h6">{currentId ? 'Editing' : 'Creating'} a Post</Typography>
                <TextField name="title" variant="outlined" label="Title" fullWidth value={postData.title} onChange={(e) => setPostData({...postData,title: e.target.value})}/>
                <TextField name="message" variant="outlined" label="Message" fullWidth multiline rows={4} value={postData.message} onChange={(e) => setPostData({...postData,message: e.target.value})}/>
                <TextField name="tags" variant="outlined" label="Hobbies" fullWidth value={postData.tags} onChange={(e) => setPostData({...postData,tags: e.target.value})}/>
                <div className={classes.fileInput}>
                    <FileBase type="file" multiple={false} onDone={({base64}) => setPostData({...postData,selectedFile: base64})}/>
                </div>
                <Button className={classes.buttonSubmit} variant="contained" color="primary" size="large" type="submit" >Submit</Button>
                <Button className={classes.buttonClear} variant="contained" color="secondary" size="large" onClick={clear} >Clear</Button>
                
            </form>
        </Paper>
    );
}

    
};

export default Form;
